import React from 'react';
import UserAccountForm from './UserAccountForm';
import ProductDataForm from './ProductList';
import UserLogin from './UserLogin';
import CreateProductForm from './CreateProductForm';
import EditProductForm from './EditProductForm';
import DeleteProductForm from './DeleteProductForm';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Dropdown } from 'react-bootstrap';

function App() {
  const [currentPage, setCurrentPage] = React.useState('landing');

  const handleNavClick = (page) => {
    if (page === 'listProducts' && !localStorage.getItem('jwtToken')) {
      alert('Você precisa estar logado para acessar a página de produtos.');
      return;
    }
    setCurrentPage(page);
  }

  return (
    <div className='App'>
      <nav className='navbar navbar-expand-lg navbar-light bg-light'>
        <span className='navbar-brand' style={{ cursor: 'default' }}>Loja do vitão</span>
        <div className='collapse navbar-collapse'>
          <ul className='navbar-nav ms-auto'>
            <li className='nav-item'>
              <button className='nav-link btn' onClick={() => handleNavClick('createAccount')}>Criar Conta</button>
            </li>
            <li className='nav-item'>
              <button className='nav-link btn' onClick={() => handleNavClick('login')}>Login</button>
            </li>
            <li className='nav-item'>
              <button className='nav-link btn' onClick={() => handleNavClick('logout')}>Sair</button>
            </li>
            <li className='nav-item'>
              <Dropdown>
                <Dropdown.Toggle variant="link" id="dropdown-basic">
                  Produtos
                </Dropdown.Toggle>

                <Dropdown.Menu>
                  <Dropdown.Item onClick={() => handleNavClick('createProduct')}>Criar Produto</Dropdown.Item>
                  <Dropdown.Item onClick={() => handleNavClick('editProduct')}>Editar Produto</Dropdown.Item>
                  <Dropdown.Item onClick={() => handleNavClick('deleteProduct')}>Deletar Produto</Dropdown.Item>
                  <Dropdown.Item onClick={() => handleNavClick('listProducts')}>Listar Produtos</Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
            </li>
          </ul>
        </div>
      </nav>
      {/*conteudo principal*/}
      <div className='container text-center mt-5'>
        {currentPage === 'landing' && (
          <div className='mt-4'>
            <h1 className='display-4'>Bem-vindo a Loja do Vitão</h1>
          </div>
        )}

        {/*criar conta*/}
        {currentPage === 'createAccount' && (
          <div className='mt-4'>
            <UserAccountForm />
          </div>
        )}

        {/*login*/}
        {currentPage === 'login' && (
          <div className='mt-4'>
            <UserLogin />
          </div>
        )}

        {/*logout*/}
        {currentPage === 'logout' && (
          <div className='mt-4'>
            <div>add o form de sair</div>
          </div>
        )}

        {/*Criar Produto*/}
        {currentPage === 'createProduct' && (
          <div className='mt-4'>
            <CreateProductForm />
          </div>
        )}

        {/*Editar Produto*/}
        {currentPage === 'editProduct' && (
          <div className='mt-4'>
            <EditProductForm />
          </div>
        )}

        {/*Deletar Produto*/}
        {currentPage === 'deleteProduct' && (
          <div className='mt-4'>
            <DeleteProductForm />
          </div>
        )}

        {/*Listar Produtos*/}
        {currentPage === 'listProducts' && (
          <div className='mt-4'>
            <ProductDataForm />
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
